import logo_1 from '../images/logo_1.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from '@mui/material/Button';
import { Avatar } from '@mui/material';
import { deepOrange } from '@mui/material/colors';
import Drawer from '@mui/material/Drawer';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import { useState } from 'react';
import Checkbox from '@mui/material/Checkbox';
import FormLabel from '@mui/material/FormLabel';
import FormControl from '@mui/material/FormControl';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormHelperText from '@mui/material/FormHelperText';

const SignedInHome = () => {

    const [isDrawerOpen, setIsDrawerOpen] = useState(false);

    const toggleDrawer = (newOpen) => () => {
        setIsDrawerOpen(newOpen);
    }

    const [ selected, setSelected ] = useState({
        action: false,
        adventure: false,
        comedy: false,
        crime : false,
        death : false,
        fantasy : false,
        historical : false,
        horror : false
    });

    const handleChange = (event) => {
        setSelected({
            ...selected, 
            [event.target.value]: event.tarhet.checked
        });
    };

    return (
        <div>
            <nav className="navbar navbar-expand-sm navbar-dark bg-dark p-0 mb-5" >
                
                <Button onClick={toggleDrawer(true)}>
                    Icon
                </Button>

                    <Drawer open={isDrawerOpen} onClose={toggleDrawer(false)}>

                        <Box sx={{ width : 250}} role='presentation' onClick={toggleDrawer(false)}>
                            <FormControl sx={{ m: 3 }} component='fieldset' variant='standard'>
                                <FormLabel component='legend' sx={{ fontFamily: 'sans-serif', fontStyle: 'oblique', color: 'black', fontWeight: 'bold',fontSize: '4rem' }}> 
                                    Choose favourite Genres
                                </FormLabel>
                            </FormControl>
                        </Box>
                    </Drawer>
                <div className="container">
                    
                    <a href='/' className='navbar-brand mb-0 h1 pt-3'>
                        <img src={logo_1} alt="Logo" width="40"/>
                            <p>NextBook.</p>
                    </a>
                
                    <Button className="navbar-toggler " type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </Button>

                    <div className="collapse navbar-collapse nav-collapse" id="navbarNav">                
                        
                        <div className="container d-flex justify-content-center">

                            <ul className="navbar-nav">
                                
                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        Home
                                    </a>
                                </li>
                            
                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        About
                                    </a>
                                </li>

                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        Contact
                                    </a>
                                </li>
                            
                            </ul>

                        </div>

                            <form action="/" className="d-flex justify-content-center">
                                <Avatar sx={{ bgcolor : deepOrange[500] }}>I</Avatar>
                            </form>
                    </div>

                </div>

            </nav>
        </div>
    );
}

export default SignedInHome;
